pub fn build_std_event(event: u8, actor_id: u8, x: u8, y: u8) -> Event {
    assert(event < EVENT_COUNT);
    assert((actor_id as u32) < MAX_CHARACTERS);
    assert((x < WIDTH) | (x == NOWHERE));
    Event {
        event: event,
        actor_id: actor_id,
        x: x,
        y: y,
        value: 0,
        subtype: 0,
        radius: 0,
    }
}

